        or revolving loans; mortgages; credit cards; life, savings and retirement
        planning, health and medical, home, motor, and travel insurance products;
        investment advisory services; retail FX products; mutual funds; and employee
        banking services. The company also provides business banking services, such
        as transaction banking comprising cash management, trade, and securities services;
        financial market solutions to meet risk management, financing, and investment
        needs; corporate finance services consisting of project and export, structured
        trade, leveraged, structured, and principal finance solutions, as well as
        mergers and acquisitions advisory services. Its business banking services
        also include renminbi services; small and medium enterprises banking services,
        such as business expansion and protection, and working capital; and Islamic
        business banking services. In addition, the company offers private, online,
        and mobile banking services. It serves companies and financial institutions,
        high net worth individuals, small businesses, and mid-sized companies. The
        company operates approximately 1,109 branches and outlets in 68 countries.
